class CheckboxList extends Component {

    render() {
        return (
            <div className="checkbox-list">
            {
                this.props.objects.map((item) => (
                    <CheckboxListItem key={this.props.items.indexOf(obj)} item={item} checkboxSelectItem={this.props.checkboxSelectItem} mappingObject={this.props.mappingObject}/>
                ))
            }
            </div>
        );
    }
}

export default CheckboxList;
